                    </div>
                    <br></br>
                    <div class = "button-wrap">
                    <button class = "rad-button wwt flat" onClick={registerMedic}>Registrar mÃ©dico</button>
                    </div>
                    <br></br>
                    <div class = "button-wrap">
                    <button class = "rad-button wwt flat" onClick={login}>Login</button>
                    </div>
            </nav>)
}
}
